import React from 'react';
import TaskItem from './TaskItem'; // Importamos el componente TaskItem
import "./ListStyle.css";

const TaskDone = ({ tasks, onToggle, onDelete}) => {//las ppropiedades como argumentos
    const tasksToDo = tasks.filter(task => task.completed);

    return (
        <div className="list">
          <h3>Tareas realizadas:</h3>
        <ul className="listaTareas , done">

        {tasksToDo.map((task) => (
          <TaskItem
            key={task.id}
            task={task}
            onToggle={onToggle}
            onDelete={onDelete}
            editable={false}

          />
        ))}
      </ul>
      </div>

    );


};

export default TaskDone;
